import React from "react";
import "./alt.css";
import { Row, Form, FormGroup } from "react-bootstrap";
import {} from "react-router-dom";
import Navigation from "./Navigation";
import Backdrop1 from "./Assets/backdrop1.jpg";

function Contact() {
  return (
    <div style={{ backgroundImage: `url(${Backdrop1}` }}>
        <Navigation />
        <Form.Group>
      <div className="textinput1">
        <h3>Name</h3>
          <Form.Control type="text" placeholder="Normal text" />
        </div>

        <h3>email</h3>
        <h3>message</h3>
        
        </Form.Group>
    </div>
  );
}

export default Contact;
